  input: TEXT,SA11A1,SA11A1.24414,"On July 9, 2004 we received a contribution from
    Don Myers, Sr.  in the amount of $25,000 which was deposited into our federal
    account.  Ten thousand dollars was reattributed to his wife, Dana Myers.  Five
    thousan dollars was transferred to our non-federal account on 7/9/04, which can
    accept unlimited contributions from individuals.A letter was sent to Don Myers,
    Sr. on the date his check was received to advise him of how his deposit was split
    into our accounts and to offer him a chance for a refund.According to AO 2001-17,
    the Commission has deemed it sufficient to deposit checks exceeding the federal
    limits into a federal account and then to make a transfer to the nonfederal account
    of the portion that exceeds the federal limit. Therefore, the year-to-date aggregate
    totals reported for Don Myers Sr. on our report is a reflection of the federal
    portion of the donor's contribution total to date."
